import React from "react";
import { withRouter } from "react-router-dom";
import {
  withStyles,
  Toolbar,
  Typography,
  MenuItem,
  Menu,
  Button,
  Grid,

  // Avatar,
  AppBar,
} from "@material-ui/core";
import ExitToAppOutlinedIcon from "@material-ui/icons/ExitToAppOutlined";
import { withAllContexts } from "../../../hocs";
import LockOutlinedIcon from "@material-ui/icons/LockOutlined";
import PersonOutlineOutlinedIcon from "@material-ui/icons/PersonOutlineOutlined";
import ExpandMoreIcon from "@material-ui/icons/ExpandMore";
import BreadcrumbsCom from "../../breadcrumbs/breadcrumbs";
import moment from "moment";

// style
const styles = (theme) => ({
  root: {
    flexGrow: 1,
    width: "100%",
  },
  menus: {
    "& .MuiMenu-paper": {
      top: "115px !important",
      marginLeft: "-16%"
    },
  },
  menusp: {
    "& .MuiMenu-paper": {
      top: "115px !important",
    },
  },
  menuButton: {
    marginRight: theme.spacing(2),

    height: "32px",

    [theme.breakpoints.only("xs")]: {
      diplay: "none",
    },
  },

  square: {
    borderRadius: 8,
    margin: "0px 4px",

    height: "42px",
    float: "right",
  },

  btnss: {
    background: "#FFFFFF 0% 0% no-repeat padding-box",
    boxShadow: "0px 3px 6px #4BCD3E1A",
    color: "#094C61",
    textTransform: "capitalize",
    opacity: "1",
    marginRight: "10px",
    fontSize: "12px",
    [theme.breakpoints.only("xs")]: {
      width: "100px",
      marginRight: "0px",
      fontSize: "12px",
      float: "right",
    },
  },
  btnss1: {
    background: "#FFFFFF 0% 0% no-repeat padding-box",
    boxShadow: "0px 3px 6px #4BCD3E1A",
    color: "#094C61",
    textTransform: "capitalize",
    opacity: "1",
    marginRight: "20px",
    width: "100px",
    fontSize: "12px",
    [theme.breakpoints.only("xs")]: {
      width: "110px",
      marginRight: "0px",
      fontSize: "12px",
    },
  },
  iconcolor: {
    fontSize: "13px",
  },

  logintitle: {
    marginTop: "7px",

    [theme.breakpoints.only("xs")]: {
      textAlign: "Center",
      marginRight: "0px",
    },
  },
  name: {
    padding: '0px 45px'
  }
});
// end
const loginUser = localStorage.getItem('user_decode') ? JSON.parse(atob(localStorage.getItem('user_decode'))) : {};

class SubHeader extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      open: false,
      drawer: false,
      open1: false
    };
  }
  // end

  // handle Profile MenuOpen lists funcy
  handleProfileMenuOpen = () => {
    debugger
    const state = this.state;
    this.setState({
      ...state,
      open: !state.open,
    });
  };

  handlelagOpen = () => {
    debugger
    const state = this.state;
    this.setState({
      ...state,
      open1: !state.open1,

    });
  }
  // end
  breadcrumbsdata = () => {
    const location = window.location.pathname;

    if (location === "/cardholder/newcard") {
      return [
        {
          title: "Card Information",
          url: "",
        },
        {
          title: "Register New Card",
          url: "",
          active: true,
        },
      ];
    } else if (location === "/cardholder/cardinfotable") {
      return [
        {
          title: "Card Information",
          url: "",
        },
        {
          title: "View Registered Card & Card Activation",
          url: "",
          active: true,
        },
      ];
    } else if (location === "/cardholder/balanceinfo") {
      return [
        {
          title: "Balance Information",
          url: "",
        },
        {
          title: "View Account Balance",
          url: "",
          active: true,
        },
      ];
    } else if (
      location === "/cardholder/Transaction_table"
    ) {
      return [
        {
          title: "Transaction History",
          url: "",
        },
        {
          title: "View Transaction Details",
          url: "",
          active: true,
        },
      ];
    } else if (
      location === "/cardholder/Transaction_filter"
    ) {
      return [
        {
          title: "Transaction History",
          url: "",
        },
        {
          title: "View Transaction Details",
          url: "",
          active: true,
        },
      ];
    } else if (
      location === "/cardholder/Transaction_filter_details"
    ) {
      return [
        {
          title: "Transaction History",
          url: "",
        },
        {
          title: "View Transaction Details",
          url: "",
          active: true,
        },
      ];
    } else if (
      location === "/cardholder/Manage_cardinfo_table"
    ) {
      return [
        {
          title: "Manage Card",
          url: "",
        },
        {
          title: "Card Status",
          url: "",
          active: true,
        },
      ];
    } else if (location === "/cardholder/card_status") {
      return [
        {
          title: "Manage Card",
          url: "",
        },
        {
          title: "Card Status",
          url: "/Manage_cardinfo_table",
        },
        {
          title: "Card Details",
          url: "",
          active: true,
        },
      ];
    } else if (
      location === "/cardholder/channel_enablement"
    ) {
      return [
        {
          title: "Manage Card",
          url: "",
        },

        {
          title:
            "Channel Enablement & Limit Management (Domestic And International)",
          url: "",
          active: true,
        },
      ];
    } else if (
      location === "/cardholder/limit_Management"
    ) {
      return [
        {
          title: "Manage Card",
          url: "",
        },

        {
          title:
            "Channel Enablement & Limit Management (Domestic And International)",
          url: "",
          active: true,
        },
      ];
    } else if (location === "/cardholder/setpin_table") {
      return [
        {
          title: "Pin Management",
          url: "",
        },

        {
          title: "Select Card Details",
          url: "",
          active: true,
        },
      ];
    } else if (location === "/cardholder/setpin_status") {
      return [
        {
          title: "Pin Management",
          url: "",
        },

        {
          title: "Select Card Details",
          url: "/setpin_table",
        },
        {
          title: "Set Pin",
          url: "",
          active: true,
        },
      ];
    } else if (location === "/cardholder/changepin_table") {
      return [
        {
          title: "Pin Management",
          url: "",
        },

        {
          title: "Select Card Details",
          url: "",
          active: true,
        },
      ];
    } else if (
      location === "/cardholder/changepin_status"
    ) {
      return [
        {
          title: "Pin Management",
          url: "",
        },

        {
          title: "Select Card Details",
          url: "/changepin_table",
        },
        {
          title: "Change Pin",
          url: "",
          active: true,
        },
      ];
    } else if (location === "/cardholder/forgot_pin") {
      return [
        {
          title: "Pin Management",
          url: "",
        },

        {
          title: "Select Card Details",
          url: "/changepin_table",
        },
        {
          title: "Change Pin",
          url: "",
          active: true,
        },
      ];
    } else if (location === "/cardholder/home") {
      return [
        {
          title: "View Profile",
          url: "",
          active: true,
        },
      ];
    } else if (location === "/cardholder/edit_profile") {
      return [
        {
          title: "View Profile",
          url: "/home",
        },
        {
          title: "Modify Profile",
          url: "",
          active: true,
        },
      ];
    }
  };

  render() {
    const { classes } = this.props;
    const { open, open1 } = this.state;

    return (
      <div className={classes.root}>
        {/* AppBar Component in Top navar */}
        <AppBar position="static" className={classes.appbar}>
          <div style={{ background: "#F4F5F8" }}>
            <Toolbar
              style={{
                background: "#F4F5F8",
                display: "flex-box",
                // float: 'right'
                justifyContent: "space-between",
              }}
            >
              <div>
                <BreadcrumbsCom data={this.breadcrumbsdata()} />
              </div>
              <div className={classes.name}>
                <Grid container spacing={1}>
                  <Grid item xs={12} sm={6} className={classes.logintitle}>
                    {!this.props.hidden && <span
                      className={classes.spanlast}
                      style={{
                        color: "#094C61",
                        fontSize: "14px",
                        marginRight: "5px",
                      }}
                    >
                      {/* <div style={{ color: "#728691", fontSize: 11, fontWeight: 500 }}>Parntner Logo</div> */}
                      Last Login:  {moment(loginUser?.[0]?.lastLogin).format('MMMM Do YYYY, h:mm')}
                      {/* slice(0,10) */}
                    </span>}
